import types from 'prop-types';
import React from 'react';

// Styles

import './styles.scss';

// ----------------

export const Navbar = ({ links }) => {
  // Render

  return (
    <div className="navbar">
      {links.map(({ label }, index) => {
        return (
          <div className = "navbar__item" key={index}>
            <div className="navbar__indicator"></div>
            <a className="navbar__label" href="\#">{label}</a>
          </div>
        );
      })}
    </div>
  );
};


function sum(a, b) {
  return a + b;
  }
   sum(1,2);
  alert( sum ); // 3

// ----------------

// Type of props

Navbar.propTypes = {
  prop: types.string,
};

// Default value for props

Navbar.defaultProps = {};
